const Corevalue = (props) => {
  return (
    <>
      <div className="core-value">
        <img src={props.img} alt="" srcset="" />
        <h3>{props.corevalue}</h3>
        <p>{props.core}</p>
      </div>
    </>
  )
}

export default Corevalue
